INSERT INTO `exchanges` (`id`, `slug`, `rank`, `name`, `logo`, `description`, `website`, `confirmed`, `created_at`, `updated_at`) VALUES
(1, 'binance', 1, 'Binance', 'binance-exchange.png', 'Binance is one of the largest cryptocurrency exchanges in the world, known for its wide range of supported cryptocurrencies, high liquidity, and advanced trading features. It offers a variety of services, including spot trading, futures, margin trading, staking, and lending.', 'https://www.binance.com/', 1, '2024-08-06 22:52:55', '2024-08-06 22:52:55'),
(2, 'gdax', 2, 'Coinbase Pro', 'gdax-exchange.png', 'Coinbase Pro, formerly known as GDAX, is a professional trading platform under the Coinbase umbrella. It provides a secure and user-friendly environment for trading a variety of cryptocurrencies, with features like advanced charting tools and real-time order books.', 'https://pro.coinbase.com/', 1, '2024-08-06 22:52:55', '2024-08-06 22:52:55'),
(3, 'gate', 3, 'Gate', 'gate-exchange.png', 'Gate.io is a comprehensive cryptocurrency exchange offering spot and margin trading, perpetual contracts, and various financial products. It supports a wide array of cryptocurrencies and is known for its security measures and extensive features.', 'https://gate.io/', 1, '2024-08-06 22:52:55', '2024-08-06 22:52:55'),
(4, 'whitebit', 4, 'WhiteBIT', 'whitebit-exchange.png', 'WhiteBIT is a European cryptocurrency exchange offering trading in numerous cryptocurrencies with advanced security features. It provides spot and margin trading, as well as staking services, with a focus on ease of use and security.', 'https://whitebit.com', 1, '2024-08-06 22:52:55', '2024-08-06 22:52:55'),
(5, 'digifinex', 5, 'DigiFinex', 'digifinex-exchange.png', 'DigiFinex is a global cryptocurrency exchange that offers spot trading, margin trading, and other financial services. It supports a wide range of cryptocurrencies and is known for its robust security measures and user-friendly interface.', 'https://www.digifinex.com/', 1, '2024-08-06 22:52:55', '2024-08-06 22:52:55'),
(6, 'kraken', 6, 'Kraken', 'kraken-exchange.png', 'Kraken is a US-based cryptocurrency exchange known for its security and regulatory compliance. It offers a variety of trading options, including spot, futures, and margin trading, as well as staking and futures contracts.', 'https://kraken.com', 1, '2024-08-06 22:52:55', '2024-08-06 22:52:55'),
(7, 'bitmax', 7, 'AscendEX (Bitmax)', 'bitmax-exchange.png', 'AscendEX, formerly Bitmax, is a digital asset trading platform offering spot and margin trading, as well as derivatives. It supports a wide range of cryptocurrencies and provides advanced trading tools and security features.', 'https://www.bitmax.io/', 1, '2024-08-06 22:52:55', '2024-08-06 22:52:55'),
(8, 'crypto', 8, 'Crypto.com Exchange', 'crypto-exchange.png', 'Crypto.com Exchange is part of the Crypto.com ecosystem, providing a secure and user-friendly platform for trading a wide variety of cryptocurrencies. It offers features like spot trading, margin trading, and derivatives, along with various financial services.', 'https://api.crypto.com/', 1, '2024-08-06 22:52:55', '2024-08-06 22:52:55'),
(9, 'uniswap-v3', 9, 'Uniswap (V3)', 'uniswap-v3-exchange.png', 'Uniswap V3 is a decentralized exchange (DEX) built on the Ethereum blockchain. It allows users to trade ERC-20 tokens directly from their wallets and provides liquidity pools for earning fees. Uniswap V3 introduces concentrated liquidity and multiple fee tiers for better capital efficiency.', 'https://uniswap.org/', 1, '2024-08-06 22:52:55', '2024-08-06 22:52:55'),
